import React from 'react';
import '../App.css';
import { Flex, Box } from 'rebass'

const dealerStyle = {
  width: '100%'
}

const BlackjackGame = () => {
  return (
    <Flex>
      <Box class='dealer'>
        Dealer
      </Box>
      <div class='player'>
        Player
        <button>HIT</button>
        <button>STAY</button>
        <button>PLAY AGAIN</button>
      </div>
      <div class='ai'>
        AI
      </div>
    </Flex>
)
}

export default BlackjackGame;
